import React, { useState } from 'react';
import {  TextField, Button, Typography } from '@mui/material';
import regimg from "../component/assets/regester.png"
import instalogo from "../component/assets/instagram-logo.png";
import FacebookIcon from '@mui/icons-material/Facebook';
import Divider from '@mui/material/Divider';
import { Link } from "react-router-dom";

function LoginPage() {
  const [formData, setFormData] = useState({
    username: '',
    password: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };


  return (
    <div className='regpage'>
       <img src={regimg} alt="" className="regimg"/>

      <form onSubmit={handleSubmit} className="regform">
      <img id="insta" src={instalogo} alt="instalogo" width={"100px"} />


        <TextField

        sx={{width:360,backgroundColor:'white',borderRadius:1}}
        label="Email"
        name="email"
          variant="filled"
          margin="normal"
          size="small"
          value={formData.email}
          onChange={handleChange}
        />
        <TextField
          fullWidth
          sx={{width:360,backgroundColor:'white',borderRadius:1}}
          label="Password"
          name="password"
            variant="filled"
            margin="normal"
            type="password"
            size="small"
          value={formData.password}
          onChange={handleChange}
        />
        <Button

          type="submit"
          variant="contained"
          color="secondary"
          size="large"
          sx={{ mt: 1 }}
        >
          Login
        </Button>
        <Divider sx={{width:"100%",color:"primary"}}>or</Divider>
        <Link id="but" to="/register">

        <Button

        type="submit"
        variant="contained"
        color="primary"
        size="small"
      >
        Register 
      </Button></Link>

      <Button
      sx={{textTransform:'capitalize'}}
        variant="contained"
        color="secondary"
        startIcon={<FacebookIcon />}
      >
        Sign Up with Facebook
      </Button>
      <Typography      sx={{textTransform:'capitalize',color:"gray"}}
>Forget Password ?</Typography>


      </form>
      </div>   );
}

export default LoginPage;
